class SynoClientStatus {
  SynoClientStatus({
    this.logs,
  });

  static Future<SynoClientStatus> get() async {
    DsmResponse res = await Api.dsm.entry("SYNO.Core.SyslogClient.Status", "latestlog_get",
        post: true,
        data: {
          "start": 0,
          "limit": 50,
          "widget": true,
          "dir": "desc",
        },
        parser: SynoClientStatus.fromJson);
    return res.data;
  }

  SynoClientStatus.fromJson(dynamic json) {
    if (json['logs'] != null) {
      logs = [];
      json['logs'].forEach((v) {
        logs?.add(Logs.fromJson(v));
      });
    }
  }
  List<Logs>? logs;
  SynoClientStatus copyWith({
    List<Logs>? logs,
  }) =>
      SynoClientStatus(
        logs: logs ?? this.logs,
      );
  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (logs != null) {
      map['logs'] = logs?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

